import styles from "./Proyects.module.css"
import {  useSelector } from "react-redux";
import HenryFoods from "../../Assets/Proyectos/HenryFoods.PNG"
import PatitasSinHogar from "../../Assets/Proyectos/PatitasSinHogar.PNG"
import LogoGitHubLight from "../../Assets/Logo/LogoGitHubLight.png"
import LogoGitHubDark from "../../Assets/Logo/LogoGitHubDark.png"


function Proyects() {
    const Dark = useSelector((state)=>state.dark)
    const Language = useSelector((state)=>state.english)

  return (
    <div className={Dark ? styles.ContainerDark : styles.ContainerLight}>
      <div className={styles.titleContainer}>
        <p className={Dark ? styles.titleDark : styles.titleLight}>{Language ? "Proyects" : "Proyectos"}</p>
        <p className={Dark ? styles.subTitleDark : styles.subTitleLight}>{Language ? "|| This are some proyects where I worked" : "|| Estos son algunos de los proyectos en los que e trabajado"}</p>
      </div>
      <div className={styles.proyectoUno}>
        <h1 className={styles.proyectTitle}>Aplicacion de recetas</h1>
        <p className={Dark ? styles.proyectDescriptionDark : styles.proyectDescriptionLight}>Una aplicación que consume datos de una API, la cual permite la visualización de recetas, con su respectiva información nutricional detallada y paso a paso para su creación. Entre algunas funcionalidades, el usuario puede filtrar las recetas por el tipo de dieta que quiera realizar, puede buscar por nombre y ordenarlas por orden alfabético y también por su nivel saludable. Tambien se le da la posibilidad al usuario de cargar su propia receta</p>
        <div>
            <img src={HenryFoods} alt="" className={styles.proyectImg}></img>
        </div>
      </div>
    </div>
  );
}

export default Proyects;
